        phase: GAME_PHASES.NIGHT,
        status: GAME_STATUSES.PLAYING,
        turn: 1,
        tick: 1,
        createdAt: expect.any(String) as string,
        updatedAt: expect.any(String) as string,
      });
    });
  });
});

